import React from 'react'
import Task from './Task'

const TaskList = ({ tasks }) => {
    
    return (
        <div className='std-padding'>
            {
                tasks.map(task => {
                    <Task key={task.id}  task={task} />
                })
            }
        </div>
    )
}

export default TaskList
